import React, { useState } from "react";
 
 
const Form = () => {
 
    const [bikeVal, setbikeFee] = useState('');
    const [carVal, setCarFee] = useState('');
    const [vanVal, setvanFee] = useState('');
 
    function onChangeCar(e) {
        setCarFee(e.target.value)
    }

    function onChangeVan(e) {
      setvanFee(e.target.value)
  }

  function onChangeBike(e) {
    setbikeFee(e.target.value)
}

 
    function onSubmit(e) {
        e.preventDefault()
        localStorage.setItem('carVal', carVal);
        localStorage.setItem('vanVal', vanVal);
        localStorage.setItem('bikeVal', bikeVal);
    }
 
    function getData() {
        console.log(localStorage.getItem('carVal'));
        console.log(localStorage.getItem('vanVal'));
        console.log(localStorage.getItem('BikeVal'));

    }
    return (
        <form className="fixed text-4xl  grid place-content-center text-black">
            <div className="border-2 relative rounded-lg p-4 pt-8 flex flex-col gap-4 bg-blue-700">
                <h1>Update PArking fee</h1>
 
                <div>
                    <form onSubmit={onSubmit}>
                        <div>
                            <label>Vehicle type</label>
                            <p>bike</p><input type="text" value={bikeVal} onChange={onChangeBike} />
                            <p>car</p><input type="text" value={carVal} onChange={onChangeCar} />
                            <p>van</p><input type="text" value={vanVal} onChange={onChangeVan} />
                        </div>

                        <button type="submit">Submit</button>
                        <button type="button" onClick={getData}>Get Data</button>
                    </form>
                </div>
            </div>
        </form>
    );
};
 
export default Form;
